produceOctalEscape :: Positioned [ByteString] -> Int -> Positioned ByteString -> Int -> Positioned ByteString -> Tokens
produceOctalEscape rs sc inp len inp'
    | x <= 0xFF = scanString (fmap (r :) rs) sc inp'
